import React, {useState} from 'react'
import App from '../App'

const AppConstext = React.createContext();

export default ({children}) => {

    const [page, setPage] = useState('dashboard');

    return (
    <AppConstext.Provider value={page}>{children}</AppConstext.Provider>
    )
}
